import styled from 'styled-components';

export const NavigationWrapper = styled.aside`

ul {
    list-style-type: none;
    margin: 0;
    padding: 0;
    overflow: hidden;

  }

  .bottomNav{
      border: 1px solid #e7e7e7;
      background-color: rgb(224, 230, 221);
  }

  .topNav{
      font-size: 25px;      
  }

  .topNav li{
    float: right;    
    display:inline;
    margin-top:20px;
    padding-left: 20px;
}



  .bottomNav li a:hover {
    background-color: rgb(176, 187, 170);
  }

  body{
      margin:0%;
  }


`;
